import UploadImg from '../component/UploadImg'

const Screen3drender =()=>{
    return(
        <div style={{height: "100%", width: "100%",alignItems:"center",flex:1 }}><UploadImg></UploadImg></div>
    
    )
}

export default Screen3drender
